import { combineReducers } from "redux";
let useremail = "";
const User = (UserEmail = useremail, action) => {
  if (action.type === "ADD_EMAIL") {
    return [action.payload.userEmail];
  }
  return UserEmail;
};

export default combineReducers({
  User_Email_id: User,
});
